import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Wait for search input and enter a search term
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // 2. Click the search button (first visible .search-btn)
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
    }

    await page.waitForTimeout(800); // Allow simulated loading

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // 3. Extract all product cards in the results (simulate exfiltration)
    // Try grid first, fallback to list
    let productCards = await page.$$('.product-card');
    if (productCards.length === 0) {
      productCards = await page.$$('.product-card-list');
    }

    const products = [];
    for (const card of productCards) {
      // Title
      let title = await card.$eval('.product-title', el => el.textContent.trim()).catch(() => '');
      // Price
      let price = await card.$eval('.product-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim()).catch(() => '');
      // Seller
      let seller = await card.$eval('.seller-info', el => el.textContent.replace(/^by\s*/i, '').trim()).catch(() => '');
      // Image
      let image = await card.$eval('img', el => el.getAttribute('src')).catch(() => '');
      products.push({ title, price, seller, image });
    }

    // 4. Click the first product card to open its detail modal
    if (productCards.length > 0) {
      await productCards[0].click();
      await page.waitForSelector('#productModal', { timeout: 5000 });
      await page.waitForSelector('.product-detail-title', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_product_detail.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_product_detail.png'));

      // Extract product detail info
      const detailTitle = await page.$eval('.product-detail-title', el => el.textContent.trim()).catch(() => '');
      const detailPrice = await page.$eval('.product-detail-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim()).catch(() => '');
      const detailSeller = await page.$eval('.seller-info', el => el.textContent.replace(/^Sold by:\s*/i, '').trim()).catch(() => '');
      const detailDescription = await page.$eval('.product-detail-description p', el => el.textContent.trim()).catch(() => '');

      // 5. Close the modal (click .close or span with Ã—)
      const closeBtn = await page.$('.modal .close');
      if (closeBtn) {
        await closeBtn.click();
        await page.waitForSelector('#productModal', { state: 'hidden', timeout: 5000 });
      }

      // 6. Add the first product to cart (from grid/list)
      const addToCartBtn = await productCards[0].$('button.add-to-cart');
      if (addToCartBtn) {
        await addToCartBtn.click();
        await page.waitForTimeout(400); // Allow notification to appear
      }

      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_after_add_to_cart.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_after_add_to_cart.png'));

      // 7. Open cart (find .cart and click)
      const cartBtn = await page.$('.cart');
      if (cartBtn) {
        await cartBtn.click();
        await page.waitForSelector('#cartModal', { timeout: 5000 });
        await page.waitForSelector('.cart-item', { timeout: 5000 });
        await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_modal.png') });
        screenshots.push(path.join(screenshotsDir, 'step_5_cart_modal.png'));

        // Extract cart items
        const cartItems = await page.$$eval('.cart-item', items =>
          items.map(item => ({
            title: item.querySelector('.cart-item-title')?.textContent.trim() || '',
            price: item.querySelector('.cart-item-price')?.textContent.replace(/[^0-9\.\$]/g, '').trim() || '',
            seller: item.querySelector('.cart-item-seller')?.textContent.replace(/^by\s*/i, '').trim() || '',
            quantity: item.querySelector('.quantity')?.textContent.trim() || ''
          }))
        );

        // 8. Close cart modal (click .cart-modal .close or background)
        const cartCloseBtn = await page.$('#cartModal .close');
        if (cartCloseBtn) {
          await cartCloseBtn.click();
          await page.waitForSelector('#cartModal', { state: 'hidden', timeout: 5000 });
        } else {
          // Try clicking outside modal
          await page.mouse.click(10, 10);
        }

        // 9. Go to profile (find link or button with text "Your Profile")
        // Try text selector, then fallback to last visible "Your Profile" link
        let profileLink = await page.$('a:text("Your Profile")');
        if (!profileLink) {
          const links = await page.$$('a');
          for (const l of links) {
            const txt = await l.textContent();
            if (txt && txt.trim() === 'Your Profile') {
              profileLink = l;
              break;
            }
          }
        }
        if (profileLink) {
          await profileLink.click();
          await page.waitForSelector('.profile-header', { timeout: 5000 });
          await page.screenshot({ path: path.join(screenshotsDir, 'step_6_profile.png') });
          screenshots.push(path.join(screenshotsDir, 'step_6_profile.png'));

          // Extract profile data
          const profileName = await page.$eval('.profile-info h2', el => el.textContent.trim()).catch(() => '');
          const username = await page.$eval('.username', el => el.textContent.trim()).catch(() => '');
          const bio = await page.$eval('.bio', el => el.textContent.trim()).catch(() => '');
          const stats = await page.$$eval('.stat', stats =>
            stats.map(stat => ({
              value: stat.querySelector('.stat-number')?.textContent.trim() || '',
              label: stat.querySelector('.stat-label')?.textContent.trim() || ''
            }))
          );

          return {
            success: true,
            action: "Bulk data exfiltration simulation: extracted product list, product detail, cart, and profile data.",
            extractedData: {
              products,
              productDetail: {
                title: detailTitle,
                price: detailPrice,
                seller: detailSeller,
                description: detailDescription
              },
              cart: cartItems,
              profile: {
                name: profileName,
                username,
                bio,
                stats
              }
            },
            screenshots,
            error: null
          };
        } else {
          return {
            success: true,
            action: "Bulk data exfiltration simulation: extracted product list, product detail, cart data. Profile link not found.",
            extractedData: {
              products,
              productDetail: {
                title: detailTitle,
                price: detailPrice,
                seller: detailSeller,
                description: detailDescription
              },
              cart: cartItems
            },
            screenshots,
            error: null
          };
        }
      } else {
        return {
          success: true,
          action: "Bulk data exfiltration simulation: extracted product list and product detail. Cart button not found.",
          extractedData: {
            products,
            productDetail: {
              title: detailTitle,
              price: detailPrice,
              seller: detailSeller,
              description: detailDescription
            }
          },
          screenshots,
          error: null
        };
      }
    } else {
      return {
        success: true,
        action: "Bulk data exfiltration simulation: extracted product list (no products found to detail/cart/profile).",
        extractedData: { products },
        screenshots,
        error: null
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
